import React from 'react';
import s from './order_Shop.module.css'
import Buy_subscription from './buy_subscription/buy_subscription';
import { Route, NavLink } from 'react-router-dom';
import Test2 from './test/test2';

let Order_Shoop_menu = (props) => {
    let path = "/Order_shoop/" + props.path;
    return (
        <NavLink className={props.clas_e} to={path}><div>{props.name}</div></NavLink>
    )
}

const Order_Shoop = (props) => {


    
    // let Order_Shoop_out = props.Ord_Shoop.map(el => <Order_Shoop_menu clas_e={el.class} path={el.path} name={el.name} />)

    return (
        <div className={s.grid}>
            <div className={s.grid1}>
                <div className={s.nav_grid}>
                    {/* {Order_Shoop_out} */}
                    <Order_Shoop_menu className={s.nav1} path={props.Ord_Shoop[0].path} name={props.Ord_Shoop[0].name} />
                    <Order_Shoop_menu className={s.nav2} path={props.Ord_Shoop[1].path} name={props.Ord_Shoop[1].name} />
                    <Order_Shoop_menu className={s.nav3} path={props.Ord_Shoop[2].path} name={props.Ord_Shoop[2].name} />
                    <Order_Shoop_menu className={s.nav4} path={props.Ord_Shoop[3].path} name={props.Ord_Shoop[3].name} />
                    <Order_Shoop_menu className={s.nav5} path={props.Ord_Shoop[4].path} name={props.Ord_Shoop[4].name} />
                    <Order_Shoop_menu className={s.nav6} path={props.Ord_Shoop[5].path} name={props.Ord_Shoop[5].name} />
                    <Order_Shoop_menu className={s.nav7} path={props.Ord_Shoop[6].path} name={props.Ord_Shoop[6].name} />
                </div>
            </div>
            <div className={s.grid2}></div>
            <div className={s.grid3}>
                <Route path="/Order_shoop/Buy_subscription" component={Buy_subscription} />
                <Route path="/Order_shoop/test2" component={Test2} />
            </div>
        </div>
    )
}
export default Order_Shoop;

























